              {/* <div > */}

              <a id="title" href="#" className="navbar-brand" style={{marginLeft:'12px'}}>Bidding Platform</a>
              {/* </div> */}
            </div>
          </nav>
        </header>
      </div>
    );
    }
    }

export default Header;
